/**
 * The reason we have this font family in a separate file is because the header is not able to share
 * css with the body of the PDF when we render with puppeteer; therefore, we extracted the normal nimbus_roman
 * font to be used for the header.
 */
exports.headerFontFace = `
@font-face {
  font-family: 'nimbus_roman';
  font-style: normal;
  font-weight: normal;
  src: url(data:application/font-woff2;charset=utf-8;base64,)
      format('woff2'),
    url(data:application/font-woff;charset=utf-8;base64,)
      format('woff');
}


@font-face {
  font-family: 'Century Schoolbook Std';
  src: url('data:font/woff2;charset=utf-8;base64,')
      format('woff2'),
    url('data:font/woff;charset=utf-8;base64,')
      format('woff');
  font-weight: normal;
  font-style: normal;
  font-display: swap;
}
`;
